import * as React from "react";

interface IconProps {
  width?: number;
  height?: number;
  fill?: string;
  className?: string;
}

const InstagramIcon: React.FC<IconProps> = React.memo(
  ({ width, height }, props) => {
    console.log("Instagram Icon rendered");
    return (
      <svg
        xmlns="http://www.w3.org/2000/svg"
        width={width}
        height={height}
        {...props}
      >
        <defs>
          <image
            id="instagramIcon"
            width={width}
            height={height}
            href="data:image/png;base64,"
          />
        </defs>
        <use href="#instagramIcon" />
      </svg>
    );
  }
);
export default InstagramIcon;
